    public int lengthOfLongestSubstring(String s) {
        char[] chars = s.toCharArray();
        int i = 0, j = 0, length = 0;
        Map<Integer, Character> charsMap = new HashMap<Integer, Character>();
        for (i = 0, j = 0; j < chars.length;) {
            if (!charsMap.containsValue(chars[j])) {
                charsMap.put(j, chars[j]);
                int sumInMap = charsMap.values().size();
                if (length < sumInMap)
                    length = sumInMap;
                j++;
            } else {
                charsMap.remove(i++);
            }
        }
        return length;
    }

